    constructor(){

        state={
            user:'',
            token: localStorage('token'),

        }

    }
    cerrarSesion= ()=>{
        localStorage.clear();
    }
    
    render() {
        return (
            !this.state.token? 
            <div>
                esto es el home :C,
                <button type= 'submit' onClick={this.cerrarSesion} > cerrar sesion </button>
            </div>
            :
            <Redirect
            from="/home"
            to="/login"/>
        )
    }
}
